import React, { Component } from 'react'
import {Link} from "react-router-dom";

import logo from './img/logo.png';
import './styles.scss';



class Footer extends Component {
    render() {
        return (
        <footer className="footer">
            <nav className="list-footer">
                <img className="logo-footer" src={logo} alt="Logo PlayerStarts" />
                    <ul>
                        <li><Link to="/">PlayerStars</Link></li>
                        <li><Link to="/regras">Regras</Link></li>
                        <li><Link to="/contato">Contato</Link></li>
                        <li><Link to="/cadastro">Participe</Link></li>
                    </ul>
                    <ul>
                        <li><Link to="/">Termos e Condições</Link></li>
                        <li><Link to="/">Nossas Políticas</Link></li>
                        <li><Link to="/">Jogo Responsável</Link></li>
                    </ul>
            </nav>
            <p>PlayerStars &copy; 2019 Todos os direitos reservados.</p>
        </footer>

        )
    }
}

export default Footer;
